import styled from "styled-components";
import { createGlobalStyle } from 'styled-components'
import Corbel from '../../Resources/corbel.ttf'

createGlobalStyle`
  @font-face {
    font-family: 'corbel';
    src: url('../../Resources/corbel.ttf');
  }
`
const Tema1_2 = styled.div`
background: #26273D;
min-height: 100%;
min-height: 100vh;
overflow: auto;    
`;

const Tema1_2_H1 = styled.h1`

    color: #A3A7B0;
    font-size: 35px;
    font-family: corbel;

`;

console.log("TESTE");

export {Tema1_2, Tema1_2_H1} ;
